import React from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../../context/AuthContext';

const AgentDashboard = () => {
    const { user } = useAuth();

    const stats = [
        { label: 'Active Bookings', value: '12', icon: 'fa-calendar-check', color: 'primary' },
        { label: 'Total Volume', value: '$14,250', icon: 'fa-dollar-sign', color: 'success' },
        { label: 'Pending Docs', value: '0', icon: 'fa-file-invoice', color: 'info' },
        { label: 'Notifications', value: '3', icon: 'fa-bell', color: 'warning' },
    ];

    const searchTools = [
        {
            title: 'Tours',
            desc: 'Find premium tour packages worldwide',
            icon: 'fa-map-marked-alt',
            link: '/agent/search/tours',
            color: '#0d6efd'
        },
        {
            title: 'Hotels',
            desc: 'Search 500,000+ hotels at B2B rates',
            icon: 'fa-hotel',
            link: '/agent/search/hotels',
            color: '#6610f2'
        },
        {
            title: 'Flights',
            desc: 'Book international & domestic flights',
            icon: 'fa-plane-departure',
            link: '/agent/search/flights',
            color: '#0dcaf0'
        },
    ];

    return (
        <div className="container-fluid p-0">
            {/* Welcome Banner */}
            <div className="row mb-4">
                <div className="col-12">
                    <div className="bg-primary text-white p-5 rounded-4 shadow-sm position-relative overflow-hidden">
                        <div className="position-relative z-index-1">
                            <h2 className="fw-bold mb-2">Welcome back, {user?.officialName}!</h2>
                            <p className="opacity-75 mb-0">Manage your business, bookings, and searches from your dedicated partner dashboard.</p>
                        </div>
                        <i className="fa fa-shuttle-van position-absolute end-0 bottom-0 opacity-10 mb-n4 me-n4" style={{ fontSize: '200px' }}></i>
                    </div>
                </div>
            </div>

            {/* Quick Stats */}
            <div className="row g-4 mb-4">
                {stats.map((stat, idx) => (
                    <div className="col-md-3 col-sm-6" key={idx}>
                        <div className="card border-0 shadow-sm rounded-4 p-4">
                            <div className="d-flex align-items-center mb-3">
                                <div className={`bg-${stat.color} bg-opacity-10 p-3 rounded-circle me-3`}>
                                    <i className={`fa ${stat.icon} text-${stat.color} fs-4`}></i>
                                </div>
                                <div>
                                    <h6 className="text-muted small mb-0">{stat.label}</h6>
                                    <h4 className="fw-bold mb-0">{stat.value}</h4>
                                </div>
                            </div>
                            <div className="progress" style={{ height: '4px' }}>
                                <div className={`progress-bar bg-${stat.color}`} style={{ width: '70%' }}></div>
                            </div>
                        </div>
                    </div>
                ))}
            </div>

            {/* B2B Services Search */}
            <h5 className="fw-bold mb-4 mt-5"><i className="fa fa-search me-2 text-primary"></i>Partner Search Tools</h5>
            <div className="row g-4 mb-5">
                {searchTools.map((tool, idx) => (
                    <div className="col-lg-4" key={idx}>
                        <Link to={tool.link} className="text-decoration-none">
                            <div className="card border-0 shadow-sm rounded-4 p-4 h-100 transition-all hover-translate-y bg-white border-start border-5" style={{ borderLeftColor: tool.color + ' !important' }}>
                                <div className="d-flex align-items-center">
                                    <div className="p-3 rounded-4 me-4" style={{ backgroundColor: tool.color + '15' }}>
                                        <i className={`fa ${tool.icon} fs-1`} style={{ color: tool.color }}></i>
                                    </div>
                                    <div>
                                        <h4 className="fw-bold mb-1 text-dark">{tool.title}</h4>
                                        <p className="text-muted small mb-0">{tool.desc}</p>
                                    </div>
                                </div>
                                <div className="mt-4 d-flex justify-content-between align-items-center">
                                    <span className="small fw-bold text-primary">Start Search <i className="fa fa-arrow-right ms-1"></i></span>
                                    <span className="badge bg-light text-dark rounded-pill border">B2B Rates</span>
                                </div>
                            </div>
                        </Link>
                    </div>
                ))}
            </div>

            <style>{`
                .hover-translate-y:hover {
                    transform: translateY(-8px);
                    box-shadow: 0 1rem 3rem rgba(0,0,0,.1) !important;
                }
                .z-index-1 { z-index: 1; }
            `}</style>
        </div>
    );
};

export default AgentDashboard;
